import React from "react";
import './footer.css';

const Footer = () => {
    return (
        <footer className="footer">
            <div className="footer-left">
                <strong>Partners</strong>
                <ul>
                    <li><a href="https://Dia.wiki">Decentralized Intelligence Agency</a></li>
                    <li><a href="https://WorldVibeWeb.org">World Vibe Web</a></li>
                    <li><a href="https://Purplerock.xyz">Purplerock</a></li>
                </ul>
            </div>
            
            <div className="footer-middle">
                <div className="contact-info">
                    <p>My Name</p>
                    <p>Email: example@example.com</p>
                </div>
                <div className="social-links">
                    <a href="https://instagram.com"><img src="instagram-logo.png" alt="Instagram" /></a>
                    <a href="https://linkedin.com"><img src="linkedin-logo.png" alt="LinkedIn" /></a>
                    <a href="https://github.com"><img src="github-logo.png" alt="GitHub" /></a>
                    <a href="https://facebook.com"><img src="facebook-logo.png" alt="Facebook" /></a>
                </div>
            </div>
            
        </footer>
    );
};

export default Footer;
